import {
  Datepicker,
  Input,
  initTE,
} from "tw-elements";

initTE({ Datepicker, Input });

const datepickerDisablePast = document.getElementById('datepicker-disable-past');
new Datepicker(datepickerDisablePast, {
  disablePast: true
});
